import { Component} from 'react'
import Nav from './Components/Nav'
import phoneBottom from './Components/phoneBottom.jpg'
import SignUpIn from './Components/SignUpIn'

class SignUpInPage extends Component{
    constructor(props){
        super(props);
        this.state = {
            username: null,
        }
        this.signIn = this.signIn.bind(this);
        this.logIn = this.logIn.bind(this);
    }

    signIn = ()=>{
        const username = this.userNameRef.value;
        const password = this.passWordRef.value;
        alert(username);
        alert(password);
    }

    logIn = ()=>{
        alert('login');
    }
    render(){
        return(
            <div className='SignUpInPage'>
                <Nav username={this.state.username} />
                <h1>Sign in to enter Contacts Page</h1>
                <SignUpIn SignInButton={this.logIn} LogInButton={this.logIn} userNameRef={value=> this.userNameRef = value} passWordRef={value=> this.passWordRef = value}/>
                <div className='phoneImg'>
                <img src={phoneBottom} />
                </div>
            </div>
        )
    }
}

export default SignUpInPage
